    revo.proxy.queryParse = function (input) {
        function sort(input) {
            if (Array.isArray(input)) return input.sort();
            if (typeof input === "object") return sort(Object.keys(input)).sort(function (a, b) {
                return Number(a) - Number(b)
            }).map(function (key) {
                return input[key]
            });
            return input
        }
        var queryStart = input.indexOf("?");
        input = input.slice(queryStart + 1);
        var ret = Object.create(null);
        if (typeof input !== "string") return ret;
        input = input.trim().replace(/^[?#&]/, "");
        if (!input) return ret;
        for (var i = 0, splitted = input.split("&"), param = splitted[i]; i <
            splitted.length; i++, param = splitted[i]) {
            var kv = param.replace(/\+/g, " ").split("=");
            kv[1] = kv[1] === undefined ? null : decodeURIComponent(kv[1]);
            kv[0] = decodeURIComponent(kv[0]);
            if (ret[kv[0]] === undefined) {
                ret[kv[0]] = kv[1];
                continue
            }
            ret[kv[0]] = [].concat(ret[kv[0]], kv[1])
        }
        return Object.keys(ret).sort().reduce(function (result, key) {
            var value = ret[key];
            if (value == true && typeof value === "object" && !Array.isArray(value)) result[key] = sort(value);
            else result[key] = value;
            return result
        }, Object.create(null))
    };
    revo.proxy.queryStringify = function (obj) {
        if (!obj) return "";
        var keys = Object.keys(obj);
        return keys.map(function (key) {
            var value = obj[key];
            if (value === undefined) return "";
            if (value === null) return encodeURIComponent(key);
            if (Array.isArray(value)) {
                const result = [];
                for (var i = 0, slices = value.slice(), value2 = slices[i]; i < slices.length; i++, value2 = slices[i]) {
                    if (value2 === undefined) continue;
                    result.push(value === null ? encodeURIComponent(key) : [encodeURIComponent(key), "=", revo.proxy.nonencodedKeys.includes(key) ? value2 : encodeURIComponent(value2)].join(""))
                }
                return result.join("&")
            }
            return encodeURIComponent(key) +
                "=" + (revo.proxy.nonencodedKeys.includes(key) ? value : encodeURIComponent(value))
        }).filter(function (x) {
            return x.length > 0
        }).join("&")
    };
    revo.proxy.parse = function (x) {
        var _t = (new Date).getTime();
        if (typeof x.d == "undefined") {
            revo.log("[REVO/Proxy] Parse Exception, undefined input");
            revo.log(x);
            return x.d
        }
        var data = false;
        var dataPrefix = "";
        if (x.t == "so") try {
            data = this.queryParse(x.d);
            dataPrefix = x.d.split("?")[0] + "?"
        } catch (err) {
            console.log(err)
        }
        if (x.t == "r") try {
            data = x.d
        } catch (err) {
            console.log(err)
        }
        if (x.t == "ro") try {
            if (x.d.indexOf('"e":') == -1) {
                revo.log("[REVO/Proxy] Parse Exception, indexOf('\"e\":') == -1");
                revo.log(x);
                return x.d
            } else data = JSON.parse(x.d)
        } catch (err) {
            console.log(err)
        }
        if (!data) {
            revo.log("[REVO/Proxy] Parse Error",
                2);
            revo.log(x, 2);
            return x.d
        }
        this.share(x.t, data);
        if (x.t == "so") try {
            data = dataPrefix + this.queryStringify(data)
        } catch (err) {
            console.log(err)
        }
        if (x.t == "ro") try {
            data = JSON.stringify(data)
        } catch (err) {
            console.log(err)
        }
        _t = (new Date).getTime() - _t;
        if (!this._timer[_t]) this._timer[_t] = 0;
        this._timer[_t] += 1;
        return data
    };
