    revo.ui._msg._ = [];
    revo.ui._msg.timer_active = false;
    revo.ui._msg.timer = function () {
        if (revo.ui._msg.timer_active) return;
        revo.ui._msg.timer_active = true;
        var job = function () {
            var cont = false;
            var _ = revo.ui._msg._;
            var i = _.length;
            var cutAt = -1;
            while (i--)
                if (_[i].timer == "none");
                else if (_[i].timer > cutAt) {
                if (_[i].timer == 0) {
                    let ii = i;
                    $(_[ii]).animate({
                        margin_right: -270
                    }, 1E3)
                }
                _[i].timer--;
                cont = true
            } else _.splice(i, 1);
            if (cont) setTimeout(job, 1E3);
            else revo.ui._msg.timer_active = false
        };
        job()
    };
    revo.ui._msg.add = function (x) {
        if (typeof x.type == "undefined") x.type = "default";
        if (typeof x.timer == "undefined") x.timer = "none";
        else x.timer_start = x.timer;
        x.hide = false;
        x.margin_right = 0;
        this._.push(x);
        if (!this.timer_active) setTimeout(revo.ui._msg.timer, 1)
    };
