            var d = '<div id="page_' + (sub ? subid : x.id) + '" class="_page_"';
            d += " v-if=\"ui._win.menu_main_active == '" + x.id + "'";
            if (sub) d += " && ui._win.menu_sub_active == '" + subid + "'";
            d += '">';
