    revo.workshop_module["m_beygr"] = {
        name: "m_beygr",
        title: "Warunek logiczny",
        desc: "Element logiczny, który sprawdza każdy warunek i decyduje, którą bramkę wyjściową aktywować w oparciu o wybraną bramkę logiczną.",
        category: "logic",
        inheritance: {
            "result": 'Decyzja podjęta przez element logiczny, możliwe wartości:<br>"true", "false"'
        },
        fields: [{
            name: "",
            type: "event",
            attr: "input"
        }, {
            name: "true",
            type: "event",
            attr: "output"
        }, {
            name: "false",
            type: "event",
            attr: "output"
        }],
        settings: {
            "gate": {
                name: "Bramka logiczna",
                help: 'AND - Wyzwala bramkę "true" gdy wszystkie warunki sie zgadzają.<br>OR - Wyzwala bramkę "true" gdy jeden z warunków się zgadza.',
                type: "select",
                options: [
                    ["AND", "and"],
                    ["OR", "or"]
                ],
                default: "and"
            },
            "conditions": {
                name: "Warunki",
                type: "textarea",
                default: "",
                help: 'Lista warunków, jeden warunek na linijkę. Dozwolone operatory: "<", ">", "==", "===", "<=", ">=" oraz ich zaprzeczenia np. "!<". Operatory "==" oraz "==="  pozwalają na porównsnie tekstu, operator "===" bierze pod uwagę wielkość znaków.<br>Przykłady warunków:<br>${ abc.liczba } >= 10<br>${ abc.liczba1 } >= ${ abc.liczba2 }<br>${ abc.tekst } == żaba'
            }
        },
        fun: function (task, data) {
            let settings =
                data.block_settings;
            let output = data.output;
            let parseString = function (string) {
                return task.parseString(string, data)
            };
            let operators = ["<", ">", "<=", ">=", "==", "==="];
            let conditions = parseString(settings.conditions).split("\n");
            let conditionsParsed = [];
            let conditionsResults = [];
            for (let i in conditions)
                for (let io in operators) {
                    let opp = " " + operators[io] + " ";
                    let opn = " !" + operators[io] + " ";
                    if (conditions[i].indexOf(opp) >= 0) {
                        let split = conditions[i].split(opp);
                        conditionsParsed.push([operators[io], split[0], split[1],
                            true
                        ])
                    }
                    if (conditions[i].indexOf(opn) >= 0) {
                        let split = conditions[i].split(opn);
                        conditionsParsed.push([operators[io], split[0].trim(), split[1].trim(), false])
                    }
                }
            for (let i in conditionsParsed) {
                let c = conditionsParsed[i];
                if (c[0] == ">") {
                    let r = parseFloat(c[1]) > parseFloat(c[2]);
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
                if (c[0] == "<") {
                    let r = parseFloat(c[1]) < parseFloat(c[2]);
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
                if (c[0] == ">=") {
                    let r = parseFloat(c[1]) >= parseFloat(c[2]);
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
                if (c[0] ==
                    "<=") {
                    let r = parseFloat(c[1]) <= parseFloat(c[2]);
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
                if (c[0] == "==") {
                    let r = c[1].toLowerCase() == c[2].toLowerCase();
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
                if (c[0] == "===") {
                    let r = c[1] == c[2];
                    if (!c[3]) r = !r;
                    conditionsResults.push(r)
                }
            }
            let result;
            if (settings.gate == "and") {
                result = true;
                for (let i in conditionsResults)
                    if (conditionsResults[i] === false) result = false
            }
            if (settings.gate == "or") {
                result = false;
                for (let i in conditionsResults)
                    if (conditionsResults[i] === true) result = true
            }
            output.result =
                result;
            if (result) task.output(0, data);
            else task.output(1, data)
        }
    };
