        "modules/addons/html/pg_themes.html": `<div style="padding-top:5px"> <div v-for="item in revo.addon" v-if="revo.addons.showOnList('theme',item._meta.key)" class="_list_button_" :revo_tip="item._meta.desc"> <div class="_name_"> <span v-if="item._meta.dev">[DEV] </span> {{ item._meta.name }} <span class="_author_"> by {{ item._meta.author }}</span> </div> <div class="_opt_box_"> <div class="_opt_" v-on:click="revo.addons.setTheme(item._meta.key)"> <i v-if="revo.addons.cfg.active_theme[revo._gameui] == item._meta.key" class="_ico_">check_box</i> <i v-if="revo.addons.cfg.active_theme[revo._gameui] != item._meta.key" class="_ico_">check_box_outline_blank</i> </div> </div> </div> </div>`,
        "modules/bgchanger/html/pg_bgselect.html": `<div style="padding-top:5px"> <div class="_form_block_1_"> <span style="display: inline-block; vertical-align: middle;line-height: 30px;">Adres tła:</span> <div class="_form_inputnsubmit_" style="width: calc(100% - 80px); float: right; margin: 0;"> <input v-model="revo.bgchanger.ui.form.bg_url.input" type="input" class="_input_" autocomplete="off" autocorrect="off" autocapitalize="off" spellcheck="false"/> <button class="_submit_" v-on:click="revo.bgchanger.ui.form.bg_url.submit">Zapisz</button> </div> </div> <div class="_form_block_1_"> Instrukcja: <button v-if="!revo.bgchanger.ui.form.instruction" v-on:click="revo.bgchanger.ui.form.instruction = true">Pokaż</button> <button v-if="revo.bgchanger.ui.form.instruction" v-on:click="revo.bgchanger.ui.form.instruction = false">Ukryj</button><br/> <span v-if="revo.bgchanger.ui.form.instruction" style="font-size: 13px; color: #8a8989;"> Adres tła powinien być bezpośrednim adresem do obrazka zaczynajacym się od "<span style="color:#c1c1c1">http://</span>" lub "<span style="color:#c1c1c1">https://</span>" i kończącym się rozszerzeniem pliku. Obsługiwane są także tła wideo, aby takowe ustawić wystarczy podać adres filmu na YouTube w następującej formie: "<span style="color:#c1c1c1">https://www.youtube.com/watch?v=elrgb2rP7zY</span>". Tło wideo powinno mieć współczynnik proporcji 16/9, w przeciwnym razie należy spodziewać się czarnych pasków po bokach. Tło wideo jest wymagającą funkcjonalnością, wymaga dobrego komputera. </span> </div> <div class="_form_block_1_"> Baza teł: <div style="cursor:pointer" v-for="item in revo.bgchanger.ui.form.bg_db" v-on:click="revo.bgchanger.ui.form.bg_url.input = item.url; revo.bgchanger.ui.form.bg_url.submit();">- {{ item.name }}</div> </div> </div>`,
        "modules/bgchanger/html/pg_bgsettings.html": `<div style="padding-top:5px"> <div class="_form_block_1_"> Zapis ustawień tła: <div class="_form_select_"> <select class="_select_" @change="revo.bgchanger.ui.form.save_mode.change" v-model="revo.bgchanger.ui.form.save_mode.selected"> <option v-for="option in revo.bgchanger.ui.form.save_mode.options" v-bind:value="option.value"> {{ option.text }} </option> </select> </div> </div> <div class="_form_block_1_"> Wyrównanie tła: <div class="_form_select_"> <select class="_select_" @change="revo.bgchanger.ui.form.bg_align.change" v-model="revo.bgchanger.ui.form.bg_align.selected"> <option v-for="option in revo.bgchanger.ui.form.bg_align.options" v-bind:value="option.value"> {{ option.text }} </option> </select> </div> </div> <div class="_form_block_1_"> Szybkość odtwarzania tła wideo: <div class="_form_select_"> <select class="_select_" @change="revo.bgchanger.ui.form.bg_vidspeed.change" v-model="revo.bgchanger.ui.form.bg_vidspeed.selected"> <option v-for="option in revo.bgchanger.ui.form.bg_vidspeed.options" v-bind:value="option.value"> {{ option.text }} </option> </select> </div> </div> <div class="_form_block_1_"> Głośność tła wideo: {{ revo.bgchanger.ui.form.bg_vidvolume.value }}% <div class="_form_range_"> <input type="range" min="0" max="100" class="_range_" @change="revo.bgchanger.ui.form.bg_vidvolume.change" v-model="revo.bgchanger.ui.form.bg_vidvolume.value"> </div> </div> <div v-if="revo._ch == 'dev'" class="_form_block_1_"> Filtry: (v-if dev) ... </div> </div>`,
