        "modules/counter/html/pg_stats.html": `<iframe src="https://docs.google.com/spreadsheets/d/e/2PACX-1vSO3K2OhCJnPsolmw9nrLZofkDK7jf0sSw81Z21OuaNnEvYnOPtTCMcGQ_4rrgTpzanmNi5gB4Pwpld/pubhtml?gid=884171567&amp;single=true&amp;widget=false&amp;headers=false" style="width: 100%; height: 1100px"></iframe>`,
        "modules/donatepage/html/pg_donate.html": `<div class="_form_block_1_"> <span style="color:#ececec;font-size:18px">Work in Progress:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Usługa jest wciąż rozwijana, stopniowo będzie przybywać funkcji wymagających <span style="color: #79b0b3">Premium</span>, postaram się też nie ograniaczać zbytnio możliwości użytkowników darmowych więc bez obaw. :]<br/>W przypadku problemów z weryfikacją licencji, należy spróbować ponownie później (najlepiej po godz. 17 w dni robocze) i dać znać jeśli nadal nie działa. (serwer troszkę niestabilny) </span><br/><br/> <span style="color:#ececec;font-size:18px">Wsparcie:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Jeśli chcesz wesprzeć rozwój REVO i wspomóc mnie w utrzymaniu serwera, możesz złożyć dobrowolny datek (PaySafeCard, PayPal). W zamian zaś otrzymasz status <span style="color: #79b0b3">Premium</span>, który przez jakiś czas da ci dostęp do rozszerzonych funkcjonalności REVO i dodatków. </span><br/><br/> <span style="color:#ececec;font-size:18px">Cennik:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Na chwilę obecną status <span style="color: #79b0b3">Premium</span> wydłuża się o miesiąc (<span style="color:#ececec;">30dni</span>) za każde wpłacone <span style="color:#ececec;"> 4zł</span>. Kwota może być dowolna, wszystko zostanie odpowiednio przeliczone. Prosiłbym jednak aby jednorazowa wpłata wynosiła nie mniej niż <span style="color:#ececec;">10zł</span>, przy mniejszych kwotach mogę odliczyć stałą prowizję (<span style="color:#ececec;">3zł</span>), którą zabiera PayPal. </span><br/><br/> <span style="color:#ececec;font-size:18px">Zwroty:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Zwroty nie są przyjmowane. Utrata dostępu do swojego konta bądź samego REVO (ban itp.) nie upoważnia do zwrotu pieniędzy czy też przeniesienia licencji na inne konto. </span><br/><br/> <span style="color:#ececec;font-size:18px">Płatność PayPal:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Aby dokonać wpłaty poprzez PayPal, należy przelać kwotę (<span style="color:#ececec;">jako opłata za usługę</span>) na adres <span style="color:#ececec;">p.skrzeczkowski@gmail.com</span> lub skorzystać z formularza (<a style="color:#ececec;cursor:pointer;" href="https://www.paypal.me/piotrskrzeczkowski" target="_blank">LINK</a>). Proszę w polu na wiadomość podać link do swojego profilu Margonem oraz umieścić frazę "<span style="color:#ececec;">REVO Premium</span>" abym nie przegapił. </span><br/><br/> <span style="color:#ececec;font-size:18px">Płatność PaySafeCard:</span><br/> <span style="color:#a5a5a5;font-size:12px"> Aby dokonać wpłaty używając kodu PaySafeCard, należy przesłać go mailem na adres <a style="color:#ececec;" href="mailto:p.skrzeczkowski@gmail.com">p.skrzeczkowski@gmail.com</a>. W tytule wiadomości poprosze umieścić frazę "<span style="color:#ececec;">REVO Premium</span>" aby się nie zgubiła, w treści wiadomości proszę podać następujące rzeczy:<br/> - Link do profilu Margonem<br/> - Kod PaySafeCard<br/> - Ilość dostępnych na nim środków (można to sprawdzić na stronie PaySafeCard)<br/> - Zdjęcie wydruku z kodem<br/> Kod zostanie użyty w całości, przed użyciem jednak kod zostanie sprawdzony ponownie, jeśli wartość kodu się nie zgadza z podaną kwotą, transakcja zostanie odrzucona. Otrzymasz odpowiedź email w przypadku akceptacji/odrzucenia wpłaty. </span> </div>`,
        "modules/donatepage/html/pg_ranking.html": `<div class="_form_block_1_"> <span style="color:#ececec;font-size:18px">Ranking wspierających:</span><br/> <span style="color:#a5a5a5;font-size:13px"> 1. Władysław Jagiełło (<a style="color: #ececec" target="_blank" href="https://www.margonem.pl/?task=profile&id=3537358">Profil</a>)<br/> 2. Kaczmuś (<a style="color: #ececec" target="_blank" href="https://www.margonem.pl/?task=profile&id=5240784">Profil</a>)<br/> 3. ...<br/> ... </span> </div>`,
        "modules/homepage/html/pg_home.html": `<div class="_form_block_1_"> Wkrótce... </div> <div class="_form_block_1_"> <b>Maddonz:</b><br> Zestaw Maddonz by Barlag zawiera 50 przydatnych dodatków do wyboru z czego większość działa na obu interfajsach gry. Trudno uwierzyć, że zestaw z tyloma przydatnymi dodatkami cieszy się tak niską popularnością, dlatego też zapraszam was do jego wypróbowania.<br> Link instalacyjny: <a href="https://barlag.ct8.pl/barlag.user.js" target="_blank" style="color:white">https://barlag.ct8.pl/barlag.user.js</a><br> Lista i opisy dodatków: <a href="https://barlag.ct8.pl/dodatki" target="_blank" style="color:white">https://barlag.ct8.pl/dodatki</a> </div>`,
